         q'[
/*
    Notes: Two-table join. Both tables in Hadoop. In-line views...
*/
select /*+
            no_merge(t)
             jfpd_027_2t_1f_1hd_multi_ilvs.sql
        */
        s.time_id
,       s.qty
from  (
       select time_id
       ,      calendar_year
       from   sh_test_h.times
      ) t
       inner join
      (
        select time_id
        ,      sum(quantity_sold) as qty
        from   sh_test_h.sales
        group  by
               time_id
      ) s
       on (t.time_id = s.time_id)
where  t.calendar_year = 1998
]',
         'jfpd_027_2t_1f_1hd_multi_ilvs.sql')
