/*
    Notes: Six-table join. Fact and two dimensions in Hadoop, three dimensions in Oracle, one Hadoop dimension filter and three Oracle dimension filters.
           Full scans forced on Oracle dimensions to ensure the table accesses are in the plan...
*/
select /*+
            full(ch)
            full(c)
            full(pr)
             jfpd_303_6t_1f_2hd_3od.sql
        */
       s.time_id
,      s.prod_id
,      s.channel_id
,      s.cust_id
,      s.promo_id
,      sum(s.quantity_sold) as qty
from   sh_test_h.sales        s
       inner join
       sh_test_h.times        t
       on (t.time_id     = s.time_id)
       inner join
       sh_test_h.products     p
       on (p.prod_id     = s.prod_id)
       inner join
       channels          ch
       on (ch.channel_id = s.channel_id)
       inner join
       customers         c
       on (c.cust_id     = s.cust_id)
       inner join
       promotions        pr
       on (pr.promo_id   = s.promo_id)
where  t.calendar_year   = 1998
and    p.prod_category   = 'Electronics'
and    c.cust_city       = 'Aalborg'
and    pr.promo_category = 'NO PROMOTION'
group  by
       s.time_id
,      s.prod_id
,      s.channel_id
,      s.cust_id
,      s.promo_id
]',
         'jfpd_303_6t_1f_2hd_3od.sql')
