         q'[
/*
    Notes: Six-table join. All tables in Hadoop, four dimensions with filters, pulldown disabled...
*/
select /*+

            no_gluent_join_filter_pulldown(s)
            no_gluent_join_filter_pulldown(t)
            no_gluent_join_filter_pulldown(p)
            no_gluent_join_filter_pulldown(ch)
            no_gluent_join_filter_pulldown(c)
            no_gluent_join_filter_pulldown(pr)
            jfpd_306_6t_1f_5hd_disabled_hints.sql
        */
       s.time_id
,      s.prod_id
,      s.channel_id
,      s.cust_id
,      s.promo_id
,      sum(s.quantity_sold) as qty
from   sh_test_h.sales        s
       inner join
       sh_test_h.times        t
       on (t.time_id     = s.time_id)
       inner join
       sh_test_h.products     p
       on (p.prod_id     = s.prod_id)
       inner join
       sh_test_h.channels     ch
       on (ch.channel_id = s.channel_id)
       inner join
       sh_test_h.customers    c
       on (c.cust_id     = s.cust_id)
       inner join
       sh_test_h.promotions   pr
       on (pr.promo_id   = s.promo_id)
where  t.calendar_year   = 1998
and    p.prod_category   = 'Electronics'
and    c.cust_city       = 'Aalborg'
and    pr.promo_category = 'NO PROMOTION'
group  by
       s.time_id
,      s.prod_id
,      s.channel_id
,      s.cust_id
,      s.promo_id
]',
         'jfpd_306_6t_1f_5hd_disabled_hints.sql')
